import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import "./style.css";

import ChatComponent from "./src/components/ChatComponent";
import Chat from "./src/components/chat/Chat";
import TimKiem from "./src/components/TimKiem/TimKiem";
import Message from "./src/components/Message";
import TuyChon from "./src/components/TuyChon";
import TuyChonBanBe from "./src/components/TuyChonBanBe";
import { View } from "react-native";
import ChonThanhVienNhom from "./src/components/ChonThanhVienNhom";
import ThemBanQR from "./src/components/TimKiem/ThemBanQR";



const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="ChatComponent">
        <Stack.Screen name="ChatComponent" component={ChatComponent}
        options={{ headerShown: false }}
        />        
        <Stack.Screen name="ChatContent" component={Chat} />       
        <Stack.Screen name="TimKiem" component={TimKiem} />       
        <Stack.Screen name="Message" component={Message} />       
      </Stack.Navigator>
    </NavigationContainer>
    // <View style={{flex: 1}}><TuyChon/></View>
    // <View style={{flex: 1}}><TuyChonBanBe/></View>
    // <View style={{flex: 1}}><ChonThanhVienNhom/></View>
    // <View style={{flex: 1}}><ThemBanQR/></View>
  );
}
